import React from "react";
import './App.css';
import { BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Header from "./Header";

function App() {
  return (
    <Router>
    <div className="app">
     <Switch>
       <Route path="/checkout">
         <h1>checkout</h1>
       </Route>
       <Route path="/login">
         <h1>Login Page</h1>
       </Route>
       {/* This is default route*/}
       <Route path="/">
         <Header/>
         <h1>HOME PAGE!!!</h1>
       </Route>
     </Switch>
    </div>
    </Router>

  );
}

export default App;
